-- ----------------------------
-- View structure for charge_info_view
-- ----------------------------
DROP VIEW IF EXISTS `charge_info_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `charge_info_view` AS select `charge_battery_info`.`id` AS `id`,`tuser`.`nickName` AS `nickName`,`tuser`.`headimgurl` AS `headimgurl`,`qr_match_device`.`area` AS `area`,`qr_match_device`.`remark` AS `remark`,`qr_match_device`.`qr_num` AS `qr_num`,`charge_battery_info`.`devicePort` AS `devicePort`,`charge_battery_info`.`startTime` AS `startTime`,`charge_battery_info`.`endTime` AS `endTime`,`charge_battery_info`.`operType` AS `operType`,`charge_battery_info`.`status` AS `status`,(`charge_battery_info`.`charge` / 100) AS `charge`,`charge_battery_info`.`chargeTime` AS `chargeTime`,`charge_battery_info`.`createDate` AS `createDate`,`qr_match_device`.`gid` AS `gid`,(`charge_battery_info`.`walletAccount` / 100) AS `walletAccount`,`charge_battery_info`.`feeStatus` AS `feeStatus`,`charge_battery_info`.`realChargeTime` AS `realChargeTime` from ((`charge_battery_info` join `qr_match_device` on((`charge_battery_info`.`deviceId` = `qr_match_device`.`match_num`))) join `tuser` on((convert(`charge_battery_info`.`openId` using utf8mb4) = `tuser`.`openId`))) ;

-- ----------------------------
-- View structure for charge_sum_view
-- ----------------------------
DROP VIEW IF EXISTS `charge_sum_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `charge_sum_view` AS select `charge_battery_info`.`operType` AS `operType`,(sum(`charge_battery_info`.`charge`) / 100) AS `charge` from (`charge_battery_info` left join `qr_match_device` on((`charge_battery_info`.`deviceId` = `qr_match_device`.`match_num`))) group by `charge_battery_info`.`operType` ;

-- ----------------------------
-- View structure for customer_card_view
-- ----------------------------
DROP VIEW IF EXISTS `customer_card_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `customer_card_view` AS select `cardlog`.`cardCode` AS `cardCode`,`cardlog`.`phyicalId` AS `phyicalId`,`cardlog`.`balance` AS `balance`,`cardlog`.`joinDate` AS `joinDate`,`customer`.`cardnum` AS `cardnum`,`customer`.`phone` AS `phone`,`customer`.`name` AS `name`,`qr_match_device`.`remark` AS `remark`,`qr_match_device`.`gid` AS `gid`,`cardlog`.`id` AS `id` from ((`cardlog` left join `customer` on((`cardlog`.`cardCode` = `customer`.`cardnum`))) join `qr_match_device` on((`cardlog`.`deviceId` = `qr_match_device`.`match_num`))) order by `cardlog`.`joinDate` desc ;

-- ----------------------------
-- View structure for weixin_query_view
-- ----------------------------
DROP VIEW IF EXISTS `weixin_query_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `weixin_query_view` AS select `tuser`.`nickName` AS `nickName`,`tuser`.`headimgurl` AS `headimgurl`,(`tuser`.`walletAccount` / 100) AS `walletAccount`,(`charge_money_info`.`money` / 100) AS `money`,(`charge_money_info`.`amount` / 100) AS `amount`,`charge_money_info`.`createTime` AS `createTime`,`charge_money_info`.`chargeType` AS `chargeType`,`charge_money_info`.`id` AS `id`,`qr_match_device`.`area` AS `area`,`qr_match_device`.`gid` AS `gid` from ((`tuser` join `charge_money_info` on((convert(`charge_money_info`.`openId` using utf8mb4) = `tuser`.`openId`))) join `qr_match_device` on((`charge_money_info`.`deviceId` = `qr_match_device`.`match_num`))) ;

-- ----------------------------
-- View structure for weixin_sum_view
-- ----------------------------
DROP VIEW IF EXISTS `weixin_sum_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `weixin_sum_view` AS select (sum(`charge_money_info`.`money`) / 100) AS `money`,(sum(`charge_money_info`.`amount`) / 100) AS `amount`,(sum(`tuser`.`walletAccount`) / 100) AS `walletaccount` from (`charge_money_info` join `tuser` on((convert(`charge_money_info`.`openId` using utf8mb4) = `tuser`.`openId`))) ;
